import React from 'react';
import '../css/Post.css'

class Post extends React.Component {
    constructor(){
        super()
        this.state = {
            verified : false
        }
    }

    render(){
        return(
            <div className="post-div">
                {this.props.content}
            </div>
        )
    }
}


export default Post
